    [
      {
        id: 1,
        text: 'Doctors Appointment',
        day: 'Feb 5th at 2:30om',
        reminder: true,
      },
      {
        id: 2,
        text: 'School',
        day: 'Feb 6th at 1:30om',
        reminder: true,
      },
      {
        id: 3,
        text: 'Food',
        day: 'Feb 5th at 2:30am',
        reminder: false,
      }
    ])
  return (
    <div className="container">
      <Header title="Task" />
      <Tasks />
    </div>
  );
}

export default App;
